<script type="text/javascript">
	function Pagg(color,stripe){
		console.log(color)
		document.getElementById("pagg_color").style.fill=color;
		var stripes = document.getElementsByClassName("pagg_stripe");
		for(var i=0;i<stripes.length;i++){
			stripes[i].style.fill = stripe;
		}
	}
	function jeans(color){
		console.log(color)

		document.getElementById("jean_color").style.fill=color;
	}
	function Shirts(color){
		console.log(color)
		
		document.getElementById("shirt_color").style.fill=color;
	}
</script>
